    const [users, setUsers] = useState([])
    const fetchData = async () => {
    const response = await fetch("http://localhost:8000/api/posts/")
    const data = await response.json()
    setUsers(data)
  }

  useEffect(() => {
    fetchData()
  }, [])
    return (
        <div>
      {users.length > 0 && (
        <ul>
          {users.map(user => (
            <li key={user.id}>{user.title} @ {user.header_image}</li>

          ))}
        </ul>
      )}
    </div>
  )
}



